import styled from 'styled-components'

const Container = styled.div``;
const Title = styled.h3``;
const TaskList = styled.div``;

const Column = (props) => {

    return (
        <Container>
            <Title>{ props.column.title}</Title>
        </Container>
    );
}

export default Column
